export const PRINTER_STATUS = {
  IDLE: "green",
  BUSY: "orange",
  QUITE_BUSY: "blue",
  DOWNED: "red",
};
export const FILE_STATUS = {
  DONE: "green",
  PENDING: "red",
  PROCESSING: "grey",
  PRINTING: "orange",
};
